import EditableTable from '../components/table/EditableTable';
import React, { useState, useEffect, useContext } from 'react';

function JobTable(props) {
  useEffect(() => {
    props.setDataSource([
      {
        key: '0',
        id: '0',
        title: '32',
        location: 'props.location1',
        Sdate: '5-10',
        Edate: '9-10',
        status: 'Yes',
      },
      {
        key: '1',
        id: ' 1',
        title: '33',
        location: 'props.location2',
        Sdate: '5-10',
        Edate: '9-10',
        status: 'Yes',
      },
    ]);
    props.setCount(2);
    setResult(dataSource);
    console.log(dataSource);
    console.log(result);
  }, [dataSource]);

  return (
    <>
      <EditableTable
        showSearch="none"
        showIcon="none"
        jobTitleT="Job Title"
        jobTitle="title"
        jobLocationT="Job Location"
        jobLocation="location"
        location1="New York"
        location2="London"
        startDateT="Start Date"
        startDate="Sdate"
        endDateT="End Date"
        endDate="Edate"
        statusT="Status"
        status="status"
        onSearch={props.onSearch}
        dataSource={props.dataSource}
        result={props.result}
      />
    </>
  );
}

export default JobTable;
